INSERT INTO `HpYuu_postmeta` VALUES (1,2,'_wp_page_template','default'),(2,3,'_wp_page_template','default'),(3,5,'_form','<label> お名前 (必須)\n    [text* your-name] </label>\n\n<label> メールアドレス (必須)\n    [email* your-email] </label>\n\n<label> 題名\n    [text your-subject] </label>\n\n<label> メッセージ本文\n    [textarea your-message] </label>\n\n[submit \"送信\"]'),(4,5,'_mail','a:8:{s:7:\"subject\";s:31:\"AyakaMatsumoto \"[your-subject]\"\";s:6:\"sender\";s:40:\"AyakaMatsumoto <wordpress@118.27.26.169>\";s:4:\"body\";s:222:\"差出人: [your-name] <[your-email]>\n題名: [your-subject]\n\nメッセージ本文:\n[your-message]\n\n-- \nこのメールは AyakaMatsumoto (http://118.27.26.169) のお問い合わせフォームから送信されました\";s:9:\"recipient\";s:22:\"8index103000@gmail.com\";s:18:\"additional_headers\";s:22:\"Reply-To: [your-email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";i:0;s:13:\"exclude_blank\";i:0;}'),(5,5,'_mail_2','a:9:{s:6:\"active\";b:0;s:7:\"subject\";s:31:\"AyakaMatsumoto \"[your-subject]\"\";s:6:\"sender\";s:40:\"AyakaMatsumoto <wordpress@118.27.26.169>\";s:4:\"body\";s:160:\"メッセージ本文:\n[your-message]\n\n-- \nこのメールは AyakaMatsumoto (http://118.27.26.169) のお問い合わせフォームから送信されました\";s:9:\"recipient\";s:12:\"[your-email]\";s:18:\"additional_headers\";s:32:\"Reply-To: 8index103000@gmail.com\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";i:0;s:13:\"exclude_blank\";i:0;}'),(6,5,'_messages','a:8:{s:12:\"mail_sent_ok\";s:75:\"ありがとうございます。メッセージは送信されました。\";s:12:\"mail_sent_ng\";s:84:\"メッセージの送信に失敗しました。後でまたお試しください。\";s:16:\"validation_error\";s:81:\"入力内容に問題があります。確認して再度お試しください。\";s:4:\"spam\";s:84:\"メッセージの送信に失敗しました。後でまたお試しください。\";s:12:\"accept_terms\";s:66:\"メッセージを送信する前に承諾確認が必要です。\";s:16:\"invalid_required\";s:42:\"必須項目に入力してください。\";s:16:\"invalid_too_long\";s:48:\"入力されたテキストが長すぎます。\";s:17:\"invalid_too_short\";s:48:\"入力されたテキストが短すぎます。\";}'),(7,5,'_additional_settings',NULL),(8,5,'_locale','ja'),(24,13,'_wp_trash_meta_status','publish'),(25,13,'_wp_trash_meta_time','1574750052'),(27,14,'_edit_lock','1575047583:1'),(28,14,'_wp_