介ページを作成するのが一般的です。たとえば以下のようなものです。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>はじめまして。昼間はバイク便のメッセンジャーとして働いていますが、俳優志望でもあります。これは僕のサイトです。ロサンゼルスに住み、ジャックという名前のかわいい犬を飼っています。好きなものはピニャコラーダ、そして通り雨に濡れること。</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>または、このようなものです。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>XYZ 小道具株式会社は1971年の創立以来、高品質の小道具を皆様にご提供させていただいています。ゴッサム・シティに所在する当社では2,000名以上の社員が働いており、様々な形で地域のコミュニティへ貢献しています。</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>新しく WordPress ユーザーになった方は、<a href=\"http://118.27.26.169/OfficeHp/wp-admin/\">ダッシュボード</a>へ行ってこのページを削除し、独自のコンテンツを含む新しいページを作成してください。それでは、お楽しみください !</p>\n<!-- /wp:paragraph -->','サンプルページ','','inherit','closed','closed','','2-revision-v1','','','2019-12-01 02:25:25','2019-11-30 17:25:25','',2,'http://118.27.26.169/2019/12/01/2-revision-v1/',0,'revision','',0),(20,1,'2019-12-01 03:52:18','2019-11-30 18:52:18','{\n    \"sidebars_widgets[sidebar-1]\": {\n        \"value\": [\n            \"pages-3\"\n        ],\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-11-30 18:52:10\"\n    },\n    \"widget_pages[3]\": {\n        \"value\": {\n            \"encoded_serialized_instance\": \"YTozOntzOjU6InRpdGxlIjtzOjA6IiI7czo2OiJzb3J0YnkiO3M6MjoiSUQiO3M6NzoiZXhjbHVkZSI7czowOiIiO30=\",\n            \"title\": \"\",\n            \"is_widget_customizer_js_value\": true,\n            \"instance_hash_key\": \"b78cc7efe8a9f3a47a82ef701b90d599\"\n        },\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-11-30 18:52:10\"\n    }\n}','','','trash','closed','closed','','058528a2-c8c7-40fc-9ed1-b9b5b9e190b5','','','2019-12-01 03:52:18','2019-11-30 18:52:18','',0,'http://118.27.26.169/?p=20',0,'customize_changeset','',0),(21,1,'2019-12-01 04:30:40','0000-00-00 00:00:00','{\n    \"stack/stinger8_child::header_image\": {\n        \"va